const Jimp = require("jimp");
const path = require("path");

async function imageOverlay() {
  // Function name is same as of file name;
  // Reading watermark Image
  let watermark = await Jimp.read(
    Buffer.from(
      "",
      "base64"
    )
  );
  watermark = watermark.resize(250, 200); // Resizing watermark image
  // Reading original image
  const image = await Jimp.read(
    path.resolve(__dirname, "..", "images", "483263.jpg")
  );
  console.log(watermark.bitmap);
  image.composite(watermark, 0, image.bitmap.height - watermark.bitmap.height, {
    mode: Jimp.BLEND_SOURCE_OVER,
    opacityDest: 0.8,
    opacitySource: 1,
  });
  // watermark.writeAsync(path.resolve(__dirname, "..", "images", "newpng.png"));
  await image.writeAsync(path.resolve(__dirname, "..", "images", "newpng.png"));
}

imageOverlay();
